import React from 'react';

class AddUser extends React.Component{
	constructor(){
		super()
		this.state = {
			firstName: '',
			lastName: '',
			email: ''
		}
	}
	
	render(){
		return(
			<div>
				<input placeholder="First Name"></input>
			</div>
		);
	}
}

export default AddUser;
